import React, { useState } from 'react';
import './Edoprod.css';

const Onboarding= () => {
  const [selectedFiles, setSelectedFiles] = useState([]);

  const files = {
    'Mavericks Details': [
      { name: 'Excel File 1', type: 'excel', path:'https://hexawareonline.sharepoint.com/:x:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/Onboarding/Mavericks_Details.xlsx?d=wed16d4bd65b440a5a6bc8f97e8ced33e&csf=1&web=1&e=h4JIKV' },


    ],
    'Onboarding': [
      { name: 'Excel File 3', type: 'excel', path: 'https://hexawareonline.sharepoint.com/:x:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/Onboarding/Onboarding.xlsx?d=w7310d4698bb8420a9ab336316d8199f3&csf=1&web=1&e=Tssygd' },
      // Add more files as needed
    ],
  };

  const handleFileDisplay = (folder) => {
    // Display all Excel files in the selected folder
    const folderFiles = files[folder];
    setSelectedFiles(folderFiles.map(file => file.path));
    window.location.href = folderFiles.map(file => file.path); // Set the location to the first file path
  };
  
  return (
    <div className="container">
      <button className="button" onClick={() => handleFileDisplay('ACFC Response')}>
      Mabericks Details
      </button>
      <button className="button" onClick={() => handleFileDisplay('Ticket Data')}>
      Onboarding
      </button>
      {selectedFiles.length > 0 && (
        <div className="file-container">
          {/* Display all Excel files in the selected folder */}
          {selectedFiles.map((path, index) => (
            <iframe key={index} className="file-display" src={path} title={`Excel File ${index}`} />
          ))}
        </div>
      )}
    </div>
  );
};

export default Onboarding;
